import React from "react";
import vendorImage from "../../../../assets/Images/car-vendor.jpg";
import ownerImage from "../../../../assets/Images/car-owner.jpg";
import { Link } from "react-router-dom";

export default function SignChoice() {
  return (
    <div className="signChoice">
      <div className="l-container">
        <div className="b-game-card">
          <div
            className="b-game-card__cover"
            style="background-image: url(https://andrewhawkes.github.io/codepen-assets/steam-game-cards/game_1.jpg);"
          ></div>
        </div>
        <div className="b-game-card">
          <div
            className="b-game-card__cover"
            style="background-image: url(https://andrewhawkes.github.io/codepen-assets/steam-game-cards/game_2.jpg);"
          ></div>
        </div>
      </div>
    </div>
  );
}
